def drugPotency(loss, expire):
    potency = 100.0
    month = 0

    while potency > expire:
        print('Month:', month, 'effectiveness:', potency)
        percentAmt = (potency * 4)/100
        potency = potency - percentAmt
    print('Month:', month, 'effectiveness:', potency,'DISCARDED')

def main():
    drugPotency(4.0, 50.0)

if __name__ == "__main__":
    main()

